import React from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

const containerStyle = {
  width: '100%',
  height: '400px'
};

const center = {
  lat: 27.7172, // Kathmandu, Nepal
  lng: 85.3240
};

// This would typically come from your backend or state management
const rentalLocations = [
  { id: 1, position: { lat: 27.7172, lng: 85.3240 }, title: "Cozy Studio in Thamel" },
  { id: 2, position: { lat: 27.6788, lng: 85.3165 }, title: "Spacious Apartment in Patan" },
  { id: 3, position: { lat: 27.7308, lng: 85.3315 }, title: "Modern Loft in Lazimpat" },
];

function RentalMap() {
  return (
    <LoadScript googleMapsApiKey={process.env.REACT_APP_GOOGLE_MAPS_API_KEY}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={12}
      >
        {rentalLocations.map((rental) => (
          <Marker
            key={rental.id}
            position={rental.position}
            title={rental.title}
          />
        ))}
      </GoogleMap>
    </LoadScript>
  );
}

export default RentalMap;
